// src/components/Training.tsx
import React from 'react';
import { Box, Paper, Typography } from '@mui/material';

const Training: React.FC = () => {
  return (
    <Paper sx={{ p: 3 }}>
      <Typography variant="h4" gutterBottom>Training & Assessment</Typography>
      <Typography>
        This page will provide interactive training modules and monthly assessments to ensure users are learning the necessary skills.
      </Typography>
    </Paper>
  );
};

export default Training;
